import React from 'react';
import ReactDOM from 'react-dom';
import CardList from './CardList';
import './index.css';
import "tachyons";
import * as serviceWorker from './serviceWorker';


ReactDOM.render(
<CardList robots = { robots } />
 ,document.getElementById('root')
);

